class SelectMySQL(object):
    def select_data(self, sql):
        result = []
        try:
            conn = MySQLdb.connect("dbhost", "dbuser", "dbpasswd",
                                   "dbname")
            cur = conn.cursor()
            cur.execute(sql)
            alldata = cur.fetchall()

            print("连接成功，开始执行sql...")
            # print(alldata)
            for rec in alldata:
                result.append(rec)  # 注意，我这里只是把查询出来的第一列数据保存到结果中了,如果是多列的话，稍微修改下就ok了
        except Exception as e:
            print('Error msg: ' + e)
        finally:
            cur.close()
            conn.close()

        return result

    def get_result(self, sql, filename):
        print(sql)
        results = self.select_data(sql)
        print('The amount of datas: %d' % (len(results)))
        with open(filename, 'w') as f:
            for result in results:
                f.write(str(result) + '\n')
        print('Data write is over!')
        return results


